import React from 'react';
import "../css/table.css"
import { Link , useNavigate} from 'react-router-dom'


import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';



const table = (SetselectMode) => {
  const [data, setData] = React.useState([]);
  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => {

        setData(data)
      });
  }
    , []);
  const onButtonClick = (mode) => {

  }
  const data1 ="hello";
  const navigate = useNavigate()

  function gotoDetails(data){
    navigate("/details",{state : {id:data}})
  
  }


  return (
    <div>



      <div class="hover-table-layout">

        <div class="listing-item">
          <figure class="image">
            <img src="https://thumbs.dreamstime.com/b/hospital-building-modern-parking-lot-59693686.jpg"/>

            <div class="listing">
              <h4>Darshankar's Hospital</h4>
              <h4>Total :60</h4>
              <h4>General : 25</h4>
              <h4>Oxygen : 15</h4>
              <h4>ICU Bed :10</h4>
              <h4>ventilator Bed : 10</h4>
              <br />


            </div>
            <h4><button type="button" class="button" onClick={() => gotoDetails("60")}>Book Now</button></h4>



          </figure>

        </div>





        {data.map((d, index) =>


          <div class="listing-item">
            <figure class="image">
              <img src={d.link} alt="image" />

              <div class="listing">
                <h4>{d.name}</h4>
                <h4>Total :{d.vacancy}</h4>
                <h4>General : {d.general_bed}</h4>
                <h4>Oxygen : {d.oxygen_bed}</h4>
                <h4>ICU Bed :{d.icu_bed}</h4>
                <h4>ventilator Bed : {d.ventilator_bed}</h4>
                <h4><button type="button" class="button" onClick={() => gotoDetails(d)}>Book Now</button></h4>

              </div>


            </figure>

          </div>




        )}
      </div>

    </div>
  )
}

export default table
